import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';
import '../style/Navigation.css';


const Navigation = ({ isMenuOpen, toggleMenu, handleMenuItemClick }) => {

    return (
        <header className="header">
            <div className="container header-content">
                <h3>My Project</h3>
                <div className={`menu-icon ${isMenuOpen ? 'active' : ''}`} onClick={toggleMenu}>
                    <FontAwesomeIcon icon={faBars} />
                </div>
                {isMenuOpen && (
                    <div className="menu-items">
                        <ul>
                            <li>
                                <a onClick={() => handleMenuItemClick('about-section')}>
                                    O nas
                                </a>
                            </li>
                            <li>
                                <a onClick={() => handleMenuItemClick('offer-section')}>
                                    Oferta
                                </a>
                            </li>
                            <li style={{ cursor: 'not-allowed' }}>
                                <button type="button" disabled>Kontakt</button>
                            </li>
                        </ul>
                    </div>
                )}
            </div>
        </header>
    );
};

export default Navigation;
